('8de922f4-58bd-11ee-a933-236cb4402701','0','2023-09-21 16:00:50','2023-09-21 13:29:24','05edb872-4919-11ee-8002-d89d6776f970','91f94f4d-57f1-11ee-a933-236cb4402701',NULL,'2f6aceb6-1f73-11ee-ac66-3cd92b4d9bf4','025c8a88-50df-11ee-a933-236cb4402701','50094d3a-1f72-11ee-ac66-3cd92b4d9bf4','2022-A-19000-19-1342-01-001','Para que el Gobierno del Estado de Nuevo León instrumente mecanismos de control y seguimiento que permitan conciliar, actualizar y validar el importe reportado a la Secretaría de Educación Pública de las transferencias de recursos estatales convenidos de los Subsidios Federales para Organismos Descentralizados Estatales, con el propósito de contribuir de manera proactiva al cumplimiento de los objetivos del programa y del marco normativo que lo rige.Los términos de esta recomendación y los mecanismos para su atención, por parte de la entidad fiscalizada, quedan asentados en el Acta de la Reunión de Presentación de Resultados Finales y Observaciones Preliminares en los términos del artículo 42 de la Ley de Fiscalización y Rendición de Cuentas de la Federación.',NULL,'N/A',1,0.00);
